	public static BufferedImage decodeToImage(String imageString) {

        BufferedImage image = null;
        byte[] imageByte;
        try {
            BASE64Decoder decoder = new BASE64Decoder();
            imageByte = decoder.decodeBuffer(imageString);
            ByteArrayInputStream bis = new ByteArrayInputStream(imageByte);
            image = ImageIO.read(bis);
            bis.close();
        } catch (Exception e) {
            e.printStackTrace();
        }
        return image;
    }

	public static void splitFeedByParentNumber(File targetFile) {
		FileInputStream fstream = null;
		DataInputStream in = null;
		BufferedReader br = null;
		BufferedWriter out = null;
		try {
			System.out.println("+++ Spliting ---> " + targetFile.getAbsolutePath() + " is Started +++");

			// Get the total Line number of file
			FileInputStream fs_countLine = new FileInputStream(targetFile);
			DataInputStream in_countLine = new DataInputStream(fs_countLine);
			BufferedReader br_countLine = new BufferedReader(new InputStreamReader(in_countLine));

			String firstLine = br_countLine.readLine();
			String productsStart = br_countLine.readLine();
			String productsEnd = "</Products>";
			String eachLine = null;
			int count = 0;
			while ((eachLine = br_countLine.readLine()) != null) {
				if (eachLine.trim().equals("</Product>")) {
					count++;
				}
			}
			br_countLine.close();
			in_countLine.close();
			fs_countLine.close();

			double nop = 1000;

			// Log number of lines in the input file.
			System.out.println("+++ Product in the file: " + count);

			double temp = (count / nop);
			int temp1 = (int) temp;
			int nof = 0;
			if (temp1 == temp) {
				nof = temp1;
			} else {
				nof = temp1 + 1;
			}
			// Log number of files to be generated
			System.out.println("+++ No. of files to be generated :" + nof);

			// ---------------------------------------------------------------------------------------------------------

			// Actual splitting of file into smaller files
			fstream = new FileInputStream(targetFile);
			in = new DataInputStream(fstream);
			br = new BufferedReader(new InputStreamReader(in));

			String spliteFileName = targetFile.getAbsolutePath().replaceAll("\\.xml$", "_");
			String strLine = null;
			boolean checkReadDone = false;
			String currentLine = "";
			boolean canAdd = true;

			// use to ignore out-of-stock items
			boolean inStock = true;

			int parentSKUCount = 0;

			Set<String> checkDuplicates = new HashSet<String>();
			for (int j = 1; j <= nof; j++) {
				if (checkReadDone) {
					break;
				}
				FileWriter fstream1 = new FileWriter(spliteFileName + j + ".xml"); // Destination
																					// File
																					// Location
				int bufferSize = 8 * 1024;
				out = new BufferedWriter(fstream1, bufferSize);
				if (j != 1) {
					out.write(firstLine);
					out.newLine();
					out.write(productsStart);
					out.newLine();
				}

				int i = 0;

				while (i <= nop) {
					strLine = br.readLine();
					if (strLine != null && strLine.length() > 0) {
						if (strLine.contains("<Parent_SKU>")) {
							parentSKUCount++;
							if (checkDuplicates.contains(strLine)) {
								canAdd = false;
							} else {
								checkDuplicates.add(strLine);
								currentLine = currentLine.concat(strLine);
							}
						} else if (strLine.contains("<Stock_Availability>N</Stock_Availability>")) {
							inStock = false;
						} else if (strLine.contains("</Product>")) {
							currentLine = currentLine.concat(strLine);
							if (canAdd && inStock) {
								out.write(currentLine);
								out.newLine();
							}
							currentLine = "";
							canAdd = true;
							inStock = true;
							i++;
						} else {
							currentLine = currentLine.concat(strLine);
						}
					} else {
						checkReadDone = true;
						out.write(productsEnd);
						break;
					}
				}

				if (j != nof) {
					out.write(productsEnd);
				}
				out.flush();
				out.close();
				System.out.println("Total Parent_SKU Count : " + parentSKUCount);
				System.out.println("+++ Spliting ---> " + targetFile.getName() + " is done");
				System.out.println("checkDuplicates : " + checkDuplicates.size());
			}
		} catch (Exception e) {
			System.err.println("### Error: " + e.getMessage());
			e.printStackTrace();
			System.out.println(Log.message("### Issue in split : " + targetFile.getName()));
		} finally {
			try {
				if (out != null) {
					out.close();
					out = null;
				}
				if (br != null) {
					br.close();
					br = null;
				}
				if (in != null) {
					in.close();
					in = null;
				}
				if (fstream != null) {
					fstream.close();
					fstream = null;
				}

				if (targetFile.exists()) {
					targetFile.delete();
				}

			} catch (IOException e) {
				e.printStackTrace();
			}
		}
	}

