	public static File removeDuplicatesByNameAndColor(File targetFile) {
		System.out.println("+++ Remove Duplicates In " + targetFile.getName() + " is Started +++");
		String path = targetFile.getAbsolutePath();
		File tempFile = null;
		File temp = new File(path);

		BufferedReader reader = null;
		BufferedWriter writer = null;
		try {

			String tempPath = targetFile.getAbsolutePath().replaceAll("\\.xml$", "_");
			tempFile = new File(tempPath + "NoDup.xml");

			reader = new BufferedReader(new FileReader(targetFile));
			writer = new BufferedWriter(new FileWriter(tempFile));

			Set<String> set = new HashSet<String>();
			// Add the title bar into the new file
			String currentLine = reader.readLine();
			if (currentLine != null) {
				writer.write(currentLine);
				writer.newLine();
			}

			while ((currentLine = reader.readLine()) != null) {
				String[] line = currentLine.split("\t");
				String product_name = line[4];
				String color = (line[33] != null && line[33].trim().length() > 0) ? line[33] : "";
				String dup = product_name.concat("-").concat(color);
				if (!set.contains(dup)) {
					set.add(dup);
					writer.write(currentLine);
					writer.newLine();
				}
			}
		} catch (IOException e) {
			System.out.println("### " + e.getMessage());
			e.printStackTrace();
		} finally {
			try {
				if (writer != null) {
					writer.close();
					writer = null;
				}
				if (reader != null) {
					reader.close();
					reader = null;
				}
				if (targetFile.exists()) {
					targetFile.delete();
					// tempFile.renameTo(temp);
					temp = null;
				}
				System.out.println("+++ Remove Duplicates In " + targetFile.getName() + " is Finished +++");
			} catch (IOException e) {
				System.out.println("### " + e.getMessage());
				e.printStackTrace();
			}
		}
		return tempFile;
	}

